import React from 'react';
import './Table.css';

const TableRow = ({ text, value }) => {
  return (
    <tr>
      <td>{text}</td>
      <td>{value}</td>
    </tr>
  );
};

const Table = ({ ...props }) => {
  const { goodRate, neutralRate, badRate } = props;
  return (
    <table>
      <thead>Statistics</thead>
      <tbody>
        <TableRow text='Good' value={goodRate} />
        <TableRow text='Neutral' value={5} />
        <TableRow text='Bad' value={5} />
        <TableRow text='Total Feedback' value={5} />
        <TableRow text='Average' value={5} />
        <TableRow text='Positive Feedback' value={5} />
      </tbody>
    </table>
  );
};

export default Table;
